import React from "react";


export default function Application() {
    return (
        <section className='application py-20'>
            <div className="container mx-auto">
                <div className="application-block p-8">
                    <h2 className="text-yellow text-center text-3xl xl:text-4xl 2xl:text-5xl">играй и выигрывай!</h2>
                </div>
            </div>
        </section>
    )
}
